import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/core/List';
import Divider from '@material-ui/core/Divider';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import { CodeOutlined, CreateOutlined, SearchOutlined, SendOutlined } from '@material-ui/icons'

const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
    drawer: {
        flexShrink: 0,

    },
    drawerPaper: {
        // width: drawerWidth,
        paddingLeft: 'calc(100vh/3)',
    },
    drawerContainer: {
        overflow: 'auto',
    },

}));

const MainDrawer = () => {
    const classes = useStyles();

    return (
        <Drawer
            className={classes.drawer}
            variant="permanent"
            classes={{
                paper: classes.drawerPaper,
            }}
        >
            <Toolbar />
            <div className={classes.drawerContainer}>
                <List>
                    <ListItem button key="Coding">
                        <ListItemIcon><CodeOutlined/></ListItemIcon>
                        <ListItemText primary="Coding" />
                    </ListItem>
                    <ListItem button key="Writing">
                        <ListItemIcon><CreateOutlined/></ListItemIcon>
                        <ListItemText primary="Writing" />
                    </ListItem>
                    <ListItem button key="Learning">
                        <ListItemIcon><SearchOutlined/></ListItemIcon>
                        <ListItemText primary="Learning" />
                    </ListItem>
                </List>
                <Divider />
                <List>
                    <ListItem button key="Contact">
                        <ListItemIcon><SendOutlined/></ListItemIcon>
                        <ListItemText primary="Contact" />
                    </ListItem>
                </List>
            </div>
        </Drawer>
    )
}

export default MainDrawer;
